import UserTasks from './UserTasks.js';


function Todolist () {
    return (
        <main>
            <form>
                <input className="todoinput"></input>
                <button className="todobutton">Add Task</button>
                <Card
                    task = {item.task}
                    day = {item.day}
                    urgency = {item.urgency}
                />

            </form>
        </main>
    )
}

export default Todolist;
